import React from 'react';

class Filters extends React.Component {
  render() {
    return (
      <div>
        <label htmlFor="search">Procurar: </label>
        <input
          type="text"
          data-testid="name-filter"
          id="search"
          onChange={(event) => dispatchSearch(event.target.value)}
        />
      </div>
    );
  }
}

export default Filters;
